export const CheckBox = ({ name, label, options }) => {
  return (
    <div className="form-check">
      <label htmlFor=""> {label}</label>
      <div>
        {options.map((o))}
        <input
          className="form-check-input"
          type="checkbox"
          value=""
          id="flexCheckDefault"
        />
        <label className="form-check-label" for="flexCheckDefault">
          {label}
        </label>
      </div>
    </div>
  );
};
